Wir xDojo, suchen einen Jungler im Elo bereich zwischen Silber-Gold f&uuml;r die Flex Q sowie anstehende Tuniere {{summoner:6}} 

Wir bieten:
- Nette Spielatmosph&auml;re sowie spa&szlig;iges Klima im Team
- einen gro&szlig;en Discord mit Spielern bei Langeweile 
- einen Stammplatz im Team sowie absprache bei Teamkompositionen

Wir wollen: 
- P&uuml;nkttlichkeit {{item:3157}} 
- Verst&auml;ndniss bei Fehlern und einsicht bei eigenen Fehlern / Kein Flame in irgenteiner Art und Toxic schon gar nicht {{sticker:sg-shisa}} 
- &Auml;nderung des Champion Pools bei passender Teamkomp.{{item:3070}} 



Wir hoffen bald mit dir unser Gl&uuml;ck probieren zu d&uuml;rfen 
{{sticker:sg-syndra}}
